# 1.16 functional interface

def genMarkets(*indicators):
    for mkt in ALL_MARKETS:
        if mkt.matching(*indicators):
            yield mkt

def genMarketSites(application=APPLICATION,
                   source=SOURCE,
                   *indicators):
    for mkt in genMarkets(*indicators):
        for site in mkt.sites:
            if ((application==None or application==site.application) and 
                (source==None or source==site.source)):
                yield site

# emulate 0.5 functional interface

def genSiteKeys(application=APPLICATION,
                source=SOURCE,
                market=None,
                city=None,
                sitekey=None,
                tier=None,
                region=None,
                *indicators):
    indicators = list(indicators)
    if market:
        indicators.append(market)
    if city:
        indicators.append(city)
    if sitekey:
        indicators.append(sitekey)
    if tier:
        indicators.append(tier)
    if region:
        indicators.append(region)
    for site in genMarketSites(application, source, *indicators):
        yield site.sitekey

def readConfig(conf=CONF):
    root = os.path.join(sys.path[0], "conf")
    cfg = jsonconf.chooseJson(conf, 'db', root=root)
    engine = cfg['engine']
    if engine=='sqlobject':
        uri = "mysql://%s:%s@%s/%s" % (cfg['user'], cfg['password'], cfg['host'], cfg['dsname'])
    else:
        uri = None
    return uri

