class MarketSite(SQLObject):
    application = StringCol(length=50)
    # source = StringCol(length=50)
    source = EnumCol(enumValues=["backpage", "cityvibe", "eros", "humaniplex", "myredbook", "sugardaddy",
                                 "emp"])
    # code is the airport Code
    # logically it is a partial key
    # but sometimes it is a placeholder/protocode (not yet realized market)
    # code = StringCol(length=5)

    market = ForeignKey('Market', default=None)

    sitekey = StringCol(length=50)
    url = StringCol(length=127)
    # string or enum("city","state","nongeo")?
    # siteType = StringCol(length=31)
    siteType = EnumCol(enumValues=["city", "state", "nongeo"])
    # string or enum("cityleaf","stateleaf","nongeoleaf")
    # pageType = StringCol(length=31)
    pageType = EnumCol(enumValues=["cityleaf", "stateleaf", "nongeoleaf"])
    parentUrl = StringCol(length=127)
    ## INDEXES
    sourceIndex = DatabaseIndex('source')
    # this made sense when we stored the code/proto-code
    # the effect of this is already done automatically by sqlo
    # codeIndex = DatabaseIndex('code')
    #marketIdIndex = DatabaseIndex('marketID')
    #sourceCodeIndex = DatabaseIndex('source', 'code')
    applicationSourceIndex = DatabaseIndex('application', 'source')

MarketSite.dropTable(ifExists=True)
MarketSite.createTable(ifNotExists=True)

